import styled, { css } from "styled-components"

const primaryColor = css`
    color:#448487
`
const Homepage = styled.div`
    margin:0 auto;
    background-color:pink;
    ${primaryColor};
    .logo{
        height: 100%;
        width: 70px;
    }
`
export default Homepage
